/*******************************************************
 * GL-GROWTH-PATTERN
 *******************************************************/
class _CNext
{
public:
	bool		on;
	uint32		dirLT[GL_GROWTH_LIMIT],	dirT[GL_GROWTH_LIMIT],	dirRT[GL_GROWTH_LIMIT],
				dirL[GL_GROWTH_LIMIT],							dirR[GL_GROWTH_LIMIT],
				dirLB[GL_GROWTH_LIMIT],	dirB[GL_GROWTH_LIMIT],	dirRB[GL_GROWTH_LIMIT];
	
	_CNext()
	{
		on = false;
		for (int32 k = 0; k < GL_GROWTH_LIMIT; k++) {
			dirLT[k] = dirT[k] = dirRT[k] = 0;
			dirL[k] = dirR[k] = 0;
			dirLB[k] = dirB[k] = dirRB[k] = 0;
		}
	}

	void				MakeDirs()
	{
		/* I must have something in each directiont to be valid.
		 */
		if (MakeDir(dirLT) != B_OK) return;
		if (MakeDir(dirT) != B_OK) return;
		if (MakeDir(dirRT) != B_OK) return;
		if (MakeDir(dirL) != B_OK) return;
		if (MakeDir(dirR) != B_OK) return;
		if (MakeDir(dirLB) != B_OK) return;
		if (MakeDir(dirB) != B_OK) return;
		if (MakeDir(dirRB) != B_OK) return;
		on = true;
	}

	_gl_dir_pattern*	NewPattern()
	{
		if (!on) return 0;
		_gl_dir_pattern*	pattern = new _gl_dir_pattern();
		if (!pattern) return 0;
		AddDir(dirLT,	pattern->dir[0]);
		AddDir(dirT,	pattern->dir[1]);
		AddDir(dirRT,	pattern->dir[2]);
		AddDir(dirL,	pattern->dir[3]);
		AddDir(dirR,	pattern->dir[4]);
		AddDir(dirLB,	pattern->dir[5]);
		AddDir(dirB,	pattern->dir[6]);
		AddDir(dirRB,	pattern->dir[7]);
		return pattern;
	}
		
private:
	status_t			MakeDir(uint32* dest)
	{
		uint32				k, total = 0;
		for (k = 0; k < GL_GROWTH_LIMIT; k++) total += dest[k];
		if (total < 1) return B_ERROR;

		vector<uint8>		vec;
		uint32				i = 0;
		for (k = 0; k < GL_GROWTH_LIMIT; k++) {
			if (dest[k] > 0) {
				uint32		num = uint32(ceil((dest[k] / float(total)) * GL_GROWTH_LIMIT));
				for (uint32 j = i; i < j + num; i++)
					vec.push_back(uint8(k));
			}
		}
		if (vec.size() < GL_GROWTH_LIMIT) {
			printf("FAILED total %ld vec size %ld\n", total, vec.size());
			if (total == 1) {
				while (vec.size() < GL_GROWTH_LIMIT) vec.push_back(vec[0]);
			}
		}
		ArpASSERT(vec.size() >= GL_GROWTH_LIMIT);
		while (vec.size() > GL_GROWTH_LIMIT) {
			uint32		diff = uint32(vec.size() - GL_GROWTH_LIMIT);
			uint32		rem = GL_GROWTH_LIMIT / diff;
			for (k = 0; k < diff; k++) {
				if (vec.size() > GL_GROWTH_LIMIT) {
					uint32	e = k * rem;
					if (e < vec.size()) vec.erase(vec.begin() + e);
				}
			}
		}
		ArpASSERT(vec.size() == GL_GROWTH_LIMIT);
#if 0
		printf("**LEFT TOP NORM'D (total %ld)\n", total);
		for (k = 0; k < vec.size(); k++) {
			printf("%ld: %d\n", k, vec[k]);
		}
#endif

		for (k = 0; k < GL_GROWTH_LIMIT; k++) dest[k] = vec[k];

		return B_OK;
	}

	void			AddDir(uint32* src, uint8* dest)
	{
		for (uint32 k = 0; k < GL_GROWTH_LIMIT; k++)
			dest[k] = ARP_CLIP_255(src[k]);
	}

public:
	void			Print(uint8 dir)
	{
#if 0
		printf("DIR %d\n", dir);
		if (dir == 7)
		for (uint32 k = 0; k < GL_GROWTH_LIMIT; k++) {
			
		}
#endif
	}
};

static bool invalid_dir(_gl_dir_pattern* pattern[GL_GROWTH_LIMIT], uint8* dir)
{
	for (uint32 k = 0; k < GL_GROWTH_LIMIT; k++) {
		if (!pattern[dir[k]]) return true;
	}
	return false;
}

static bool invalid_pattern(_gl_dir_pattern* pattern[GL_GROWTH_LIMIT], uint32 k)
{
	if (invalid_dir(pattern, pattern[k]->dir[0])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[1])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[2])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[3])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[4])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[5])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[6])) return true;
	if (invalid_dir(pattern, pattern[k]->dir[7])) return true;
	return false;
}

static bool invalid_neighbors(_gl_dir_pattern* pattern[GL_GROWTH_LIMIT])
{
	bool		ans = false;
	for (uint32 k = 0; k < GL_GROWTH_LIMIT; k++) {
		if (pattern[k]) {
			if (invalid_pattern(pattern, k)) {
				delete pattern[k];
				pattern[k] = 0;
				ans = true;
			}
		}
	}
	return ans;
}

